import "./style.css";

import { Link } from 'react-router-dom';

function CardListDebts({ status, list, debts }) {
  return (
    <div className="Debt CardContainer">
      <div className="CardTitle">
          <h1>
          {status === "paid" ? "Cobranças Pagas" : 
          status === "expired" ? "Cobranças Vencidas" : 
          "Cobranças Previstas"}
          </h1>
        <p
          className={status === "expired" ? "DebtCount Red" : 
          status === "pending" ? "DebtCount Yellow" : 
          "ClientCount Green"}
        >
          {debts.count}
        </p>
      </div>
      <div className="TableContainer">
        <div className="TableHead">
          <strong className="TableColumn FirstColumn">
            Cliente
          </strong>
          <strong className="TableColumn MidColumn">
            ID da cob.
          </strong>
          <strong className="TableColumn LastColumns">
            Valor
          </strong>
        </div>
        <div className="TableBody">
          {data.map((item) => {
            return (
              <div className="TableRow" key={item.name}>
                <span className="TableColumn FirstColumn">{item.name}</span>
                <span className="TableColumn MidColumns">
                  {item.chargeId}
                </span>
                <span className="TableColumn LastColumns">
                  R$ {item.value}
                </span>
              </div>
            );
          })}
        </div>
        <div className="CardBottom">
          <Link to='/debt-collection'>Ver todos</Link>
        </div>
      </div>
    </div>
  );
}

export default CardListDebts;
